import './App.css';
import React from 'react'
import Home from './pages/Home';
import ProductList from './pages/ProductList';
import Product from './pages/Product';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home/>}>
        </Route>
      </Routes>
    </Router>
  );
};

export default App;
